    "2015-09-27T00:26:32.694718",nt"name": "florida-keys-national-marine-sanctuary-socioeconomic-study-fknms-fishers-2005-panel",nt"isopen":
    false,nt"url": null,nt"notes": "This project describes results from the
    2004-05 collection year from four panels of commercial fishers in the Florida Keys
    National Marine Sanctuary: Dry Tortugas panel; Sambos panel; marine life panel;
    and general panel. The fishers on each panel (9 on the Dry Tortugas panel and 5
    in each of the other panels) provide catch, effort, cost, and other fishing information,
    including areas fished, as well as their views on FKNMS management. The panel mapping
    project includes the mapping of catch areas by fisher in terms of individual catch,
    effort, and costs by species.",nt"license_title": null,nt"extras": [{ntt"key":
